import React, { useContext } from "react";
import Context from "../../Context/Context";

const GoodsList = () => {
  const value = useContext(Context);
  const { items } = value;
  return( 
  <Grid container>
    {items.map((item))}
    </Grid>
    )
};

export default GoodsList;
